--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "CEK_IS_CES_TRX_EXIST" 
(vMSISDN in varchar2, vID_TRX in varchar2)
return number

is

vOutputCek        number;    
      
Begin


    begin
        
    
        -- cari dari semua ces_master per hari ini
        execute immediate
        '
        select  1 
        from    API_MYTSEL_V2 
        WHERE   MSISDN = :1 
                AND ID_TRX = :2 
                and api_date = to_date(to_char(sysdate,''rrrrmmdd''),''rrrrmmdd'')
                and rownum = 1
        '
        into    vOutputCek
        using   vMSISDN,
                vID_TRX;
                
    exception when no_data_found then
    
        vOutputCek := 0;
            
        
    end;
    
    Return vOutputCek;

End; 

