--  DDL for Procedure GET_CODE_API_MYTSEL_V2_REF
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "GET_CODE_API_MYTSEL_V2_REF" (VREF IN VARCHAR2, VFLAG IN VARCHAR2, VOUT_CODE OUT NUMBER) IS

--DECLARE
    
    VCOLUMN_CODE        NUMBER := 0;
    VOUT                NUMBER := 0;
    
--    PRAGMA AUTONOMOUS_TRANSACTION;
    
BEGIN
    
    EXECUTE IMMEDIATE
    '
    SELECT  COLUMN_CODE
    FROM    API_MYTSEL_V2_REF
    WHERE   COLUMN_REF = :VREF 
            AND COLUMN_FLAGING = :VFLAG
    '
    INTO VOUT_CODE USING VREF, VFLAG;

EXCEPTION WHEN NO_DATA_FOUND THEN

    EXECUTE IMMEDIATE
    '
    SELECT  API_MYTSEL_V2_REF_S.NEXTVAL
    FROM    DUAL
    '
    INTO VOUT_CODE;
    
    EXECUTE IMMEDIATE
    '
    VALUES (:VCOLUMN_CODE, :VREF, :VFLAG)
    '
    
    USING VOUT_CODE, VREF, VFLAG;
    
    COMMIT;
    
END; 

/
