--  DDL for Procedure HOUSE_KEEPING_MYTSEL_API
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "HOUSE_KEEPING_MYTSEL_API" (vPeriod varchar2) is

--declare

    TYPE ItemRec IS RECORD
    (
    v_id_trx    varchar2(50),
    v_score     number
    );
     
    TYPE ItemSet IS TABLE OF ItemRec;
    dup_items ItemSet;
    
    TYPE ItemRec2 IS RECORD
    (
    v_id_trx    varchar2(50),
    v_score     number
    );
     
    TYPE ItemSet2 IS TABLE OF ItemRec2;
    dup_items2 ItemSet2;
    
    vCount  number:=0;

begin

    EXECUTE IMMEDIATE 'TRUNCATE TABLE DELETE_API_MYTSEL';

    execute immediate
    '
    select  id_trx,
            score
    from    api_mytsel_v2
    where   api_date=to_date(:1,''rrrrmmdd'')
    '
    bulk collect
    into    dup_items
    using   vPeriod;
    
    IF dup_items.COUNT > 0 THEN
    
        FOR i IN dup_items.FIRST..dup_items.LAST
        
            loop
            
                vCount := vCount + 1 ;
            
                begin
                
                    execute immediate
                    '
                    values (:1, :2)
                    '
                    using   dup_items(i).v_id_trx,
                            dup_items(i).v_score;
                            
                exception when dup_val_on_index then
                    null;
                                 
                end;
                
                if vCount = 1000 then
                
                    vCount := 0;
                    commit;
                
                end if;
            
            end loop;
            
            commit;
        
    END IF;
        
        
    vCount := 0;
        
        
    execute immediate
    '
    select  id_trx,
            score
    from    DELETE_API_MYTSEL
    where   delete_status=0
    '
    bulk collect
    into    dup_items2;
    
    IF dup_items2.COUNT > 0 THEN
    
        FOR a IN dup_items2.FIRST..dup_items2.LAST
        
            loop
            
                vCount := vCount + 1 ;
                
                execute immediate
                '
                update  DELETE_API_MYTSEL
                set     delete_status=1
                where   id_trx=:1
                '
                using   dup_items2(a).v_id_trx;
            
                begin
                
                    execute immediate
                    '
                    delete  api_mytsel_v2
                    where   id_trx=:1
                    '
                    using   dup_items2(a).v_id_trx;
                            
                end;
                
                if dup_items2(a).v_score = 1 then
                
                    begin
                
                        execute immediate
                        '
                        delete  api_mytsel_score
                        where   id_trx=:1
                        '
                        using   dup_items2(a).v_id_trx;
                                
                    end;  
                
                end if;
                
                execute immediate
                '
                update  DELETE_API_MYTSEL
                set     delete_status=2
                where   id_trx=:1
                '
                using   dup_items2(a).v_id_trx;
                
                if vCount = 100 then
                
                    vCount := 0;
                    commit;
                
                end if;
            
            end loop;
        
    END IF;
        
        commit;
    


end; 

/
